import React from 'react';
function App() {

    const [square,setSquares] = React.useState(boxes);



    const squareElements = squares.map(square => (
        <div className="box" key={square.id}></div>
    ))


    return (
        <main>
            <h1>Boxes will go here</h1>
            {squareElements}
        </main>
    )
}

export default App;
